('basic', 0, 1, 1, 'en', 0, '<p>Interactively transition multidisciplinary niche markets before seamless best practices. Rapidiously recaptiualize synergistic supply chains without client-centric materials. Appropriately optimize transparent experiences and diverse ideas.&nbsp;</p>\r\n', '', 'basic_html'),
