('basic', 0, 3, 3, 'en', 0, '<div style=\"text-align:center;\">\r\n<h2>Available features and pages</h2>\r\n</div>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h4>Full width page</h4>\r\n\r\n<p>Donec sed odio dui. Nulla vitae elit libero, a pharetra augue. Nullam id dolor id nibh ultricies vehicula ut id elit. Integer posuere erat a ante venenatis dapibus posuere velit aliquet.</p>\r\n\r\n<p><a href=\"node/4\">More »</a></p>\r\n</div>\r\n\r\n<div class=\"col-md-6\">\r\n<h4>Page with two sidebars</h4>\r\n\r\n<p>Donec sed odio dui. Nulla vitae elit libero, a pharetra augue. Nullam id dolor id nibh ultricies vehicula ut id elit. Integer posuere erat a ante venenatis dapibus posuere velit aliquet.</p>\r\n\r\n<p><a href=\"node/5\">More »</a></p>\r\n</div>\r\n</div>\r\n', '', 'full_html'),
('basic', 0, 4, 4, 'en', 0, '<ul class=\"icons-list text-right\">\r\n	<li class=\"text\">Follow us on social media</li>\r\n	<li class=\"facebook\"><a href=\"http://www.facebook.com/morethan.just.themes/\"><i class=\"fa fa-facebook\"><span class=\"sr-only\">facebook</span></i></a></li>\r\n	<li class=\"twitter\"><a href=\"http://twitter.com/morethanthemes/\"><i class=\"fa fa-twitter\"><span class=\"sr-only\">twitter</span></i></a></li>\r\n	<li class=\"googleplus\"><a href=\"https://plus.google.com/118354321025436191714/posts\"><i class=\"fa fa-google-plus\"><span class=\"sr-only\">google plus</span></i></a></li>\r\n	<li class=\"linkedin\"><a href=\"http://www.linkedin.com/company/more-than-themes/\"><i class=\"fa fa-linkedin\"><span class=\"sr-only\">linkedin</span></i></a></li>\r\n	<li class=\"youtube\"><a href=\"http://www.youtube.com/morethanthemes/\"><i class=\"fa fa-youtube-play\"><span class=\"sr-only\">youtube</span></i></a></li>\r\n	<li class=\"instagram\"><a href=\"http://instagram.com/\"><i class=\"fa fa-instagram\"><span class=\"sr-only\">instagram</span></i></a></li>\r\n	<li class=\"flickr\"><a href=\"http://www.flickr.com/photos/morethanthemes/\"><i class=\"fa fa-flickr\"><span class=\"sr-only\">flickr</span></i></a></li>\r\n	<li class=\"vimeo\"><a href=\"http://vimeo.com/morethanthemes\"><i class=\"fa fa-vimeo-square\"><span class=\"sr-only\">vimeo</span></i></a></li>\r\n	<li class=\"pinterest\"><a href=\"http://www.pinterest.com/morethanthemes/\"><i class=\"fa fa-pinterest\"><span class=\"sr-only\">pinterest</span></i></a></li>\r\n	<li class=\"skype\"><a href=\"#\"><i class=\"fa fa-skype\"><span class=\"sr-only\">skype</span></i></a></li>\r\n</ul>\r\n', '', 'full_html'),
('basic', 0, 5, 5, 'en', 0, '<p>Objectively conceptualize high standards in intellectual capital vis-a-vis covalent meta-services. Dramatically synthesize just in time core competencies through interactive intellectual capital. Compellingly impact focused mindshare after fully researched testing procedures. Seamlessly benchmark enabled e-commerce with low-risk high-yield niches.</p>\r\n\r\n<p><a class=\"button\" href=\"#\">Get in touch</a></p>\r\n', '', 'full_html'),
('basic', 0, 6, 6, 'en', 0, '<div style=\"text-align:center;\">\r\n<h2>Yet more available pages</h2>\r\n</div>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-6\">\r\n<h4>Responsive grid</h4>\r\n\r\n<p>Donec sed odio dui. Nulla vitae elit libero, a pharetra augue. Nullam id dolor id nibh ultricies vehicula ut id elit. Integer posuere erat a ante venenatis dapibus posuere velit aliquet.</p>\r\n\r\n<p><a href=\"node/7\">More »</a></p>\r\n</div>\r\n\r\n<div class=\"col-md-6\">\r\n<h4>Typography</h4>\r\n\r\n<p>Donec sed odio dui. Nulla vitae elit libero, a pharetra augue. Nullam id dolor id nibh ultricies vehicula ut id elit. Integer posuere erat a ante venenatis dapibus posuere velit aliquet.</p>\r\n\r\n<p><a href=\"node/1\">More »</a></p>\r\n</div>\r\n</div>\r\n', '', 'full_html'),
('basic', 0, 7, 7, 'en', 0, '<p>Startup Growth Lite is the free version of <a href=\"http://www.morethanthemes.com/?q=themes/startupgrowth&amp;mt-referral=scholarlylite\" target=\"_blank\">Startup Growth</a> by <a href=\"http://www.morethanthemes.com/&amp;mt-referral=scholarlylite\" target=\"_blank\"> More than Themes</a>.</p>\r\n\r\n<p>Startup Growth Lite is provided for everyone in the Drupal community to use and enjoy. You can use it for your personal or commercial projects, without any limitation. Although attribution is very much appreciated, it is not required.</p>\r\n\r\n<div class=\"more-link\"><a href=\"node/3\">Read more</a></div>\r\n', '', 'full_html'),
('basic', 0, 8, 8, 'en', 0, '<p>Startup Growth Lite comes with a wealth of regions and classes, providing, among others, a rich multi-level footer where you can place lots of information about your site.</p>\r\n\r\n<p>Therefore, the important pages of your site, can always be just one click away for your visitor, regardless where in your site they are navigating.</p>\r\n', '', 'full_html'),
('basic', 0, 9, 9, 'en', 0, '<p>Startup Growth Lite is a free theme, contributed to the Drupal Community by <a href=\"http://www.morethanthemes.com/&mt-referral=startupgrowthlite\" target=\"_blank\">More than Themes</a>.</p>', '', 'full_html'),
('basic', 0, 10, 10, 'en', 0, '<div class=\"row\">\r\n<div class=\"col-md-8\">\r\n<h2>Lorem ipsum dolor sit amet</h2>\r\n\r\n<p>Phosfluorescently utilize future-proof scenarios whereas timely leadership skills. Seamlessly administrate maintainable quality vectors whereas proactive mindshare.</p>\r\n\r\n<p>Dramatically plagiarize visionary internal or \"organic\" sources via process-centric. Compellingly exploit worldwide communities for high standards in growth strategies.</p>\r\n\r\n<p><a class=\"button\" href=\"#\">Get free trial</a></p>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<div class=\"call-to-action\">\r\n<p>Not sure yet?<br />\r\n<a href=\"#\">Get in touch</a> with us or take our <a href=\"#\">free trial</a>.</p>\r\n<a class=\"button\" href=\"#\">get the free trial</a></div>\r\n</div>\r\n</div>\r\n', '', 'full_html');

