('basic', 0, 8, 8, 'en', 0, '<p>Startup Growth Lite comes with a wealth of regions and classes, providing, among others, a rich multi-level footer where you can place lots of information about your site.</p>\r\n\r\n<p>Therefore, the important pages of your site, can always be just one click away for your visitor, regardless where in your site they are navigating.</p>\r\n', '', 'full_html'),
('basic', 0, 9, 9, 'en', 0, '<p>Startup Growth Lite is a free theme, contributed to the Drupal Community by <a href=\"http://www.morethanthemes.com/&mt-referral=startupgrowthlite\" target=\"_blank\">More than Themes</a>.</p>', '', 'full_html'),
('basic', 0, 10, 10, 'en', 0, '<div class=\"row\">\r\n<div class=\"col-md-8\">\r\n<h2>Lorem ipsum dolor sit amet</h2>\r\n\r\n<p>Phosfluorescently utilize future-proof scenarios whereas timely leadership skills. Seamlessly administrate maintainable quality vectors whereas proactive mindshare.</p>\r\n\r\n<p>Dramatically plagiarize visionary internal or \"organic\" sources via process-centric. Compellingly exploit worldwide communities for high standards in growth strategies.</p>\r\n\r\n<p><a class=\"button\" href=\"#\">Get free trial</a></p>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<div class=\"call-to-action\">\r\n<p>Not sure yet?<br />\r\n<a href=\"#\">Get in touch</a> with us or take our <a href=\"#\">free trial</a>.</p>\r\n<a class=\"button\" href=\"#\">get the free trial</a></div>\r\n</div>\r\n</div>\r\n', '', 'full_html');

