('page', 0, 3, 3, 'en', 0, '<h3>Introduction</h3>\r\n\r\n<p><a href=\"http://www.morethanthemes.com/&amp;mt-referral=startupgrowthlite\" target=\"_blank\">More than (just) Themes</a> proudly presents some of the best Drupal, HTML &amp; PSD themes &amp; toolsets around. Some <a href=\"http://www.drupalizing.com/\" target=\"_blank\">awesome freebies</a> too. With pixel-perfect design, automated installation procedure, unique support and detailed installation instructions, all created by people you can easily reach, people like you; bloggers, web designers, coders and Drupal geeks.</p>\r\n\r\n<h3>About Startup Growth and Our Mission</h3>\r\n\r\n<p>Startup Growth Lite has been contributed to Drupal and is supported by <a href=\"http://www.morethanthemes.com/&amp;mt-referral=startupgrowthlite\" target=\"_blank\">More than (just) Themes</a>, as part of our ongoing effort to bring top quality themes to the Drupal community.</p>\r\n\r\n<blockquote>Startup Growth Lite has been contributed to Drupal and is supported by <a href=\"http://www.morethanthemes.com/&amp;mt-referral=startupgrowthlite\" target=\"_blank\">More than (just) Themes</a>, as part of our ongoing effort to bring top quality themes to the Drupal community.</blockquote>\r\n\r\n<p>Startup Growth Lite is a free Bootstrap-based theme for Drupal, based on our highly popular <a href=\"http://www.morethanthemes.com/?q=themes/startupgrowth/&amp;mt-referral=mtt-startupgrowthlite\" target=\"_blank\">premium Startup Growth</a> theme.</p>\r\n\r\n<p>You can use Startup Growth Lite without limitations for your personal or commercial projects. Although attribution is very much appreciated, it is not required.</p>\r\n\r\n<h4>Contact</h4>\r\n\r\n<p>At <a href=\"http://www.morethanthemes.com/&amp;mt-referral=startupgrowthlite\" target=\"_blank\">More than (just) Themes</a> we will continue to maintain, improve and enrich our free themes with new features as they occur by discussions in the community.</p>\r\n\r\n<blockquote>At <